import "./App.css";
import Home from "./components/Home";
import Login from "./components/Login";

function App() {
  return (
    <div className="App">

<Routes>
        <Route path="/" element={<SearchUserName placeholder="Enter github username.." />} />
        <Route path="/history" element={<HistoryScreen />} />
      </Routes> 
      <>
        <Login />
        <Home />
      </>
    </div>
  );
}

export default App;
